import Main from './pages/main/main.component';
import Sidebar from '../../components/sidebar/sidebar.component'
import Introduction from '../../components/introduction/introduction.component'
import { GlobalStyle } from './global.styles'
import { ContentContainer, MainContainer, SidebarContainer } from './pages/main/main.styles'

function App() {
  return (
    <div>
      <GlobalStyle />
      <MainContainer>
      <SidebarContainer>
        <Sidebar />
      </SidebarContainer>
      <ContentContainer>
        <Introduction />
      </ContentContainer>
    </MainContainer>
    </div>
  );
}

export default App;
